import React from 'react';
import { Box, Button, Typography, Card, CardContent, Stack } from '@mui/material';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import PersonIcon from '@mui/icons-material/Person';
import { useHistory } from 'react-router-dom';

export default function AuthHome() {
  const history = useHistory();

  return (
    <Box 
      sx={{ 
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: '#0A1929',
        position: 'relative',
        overflow: 'hidden',
        p: { xs: 2, sm: 4 }
      }}
    >
      {/* Mesh Gradient Background */}
      <Box
        sx={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          opacity: 0.6,
          background: 'radial-gradient(at 80% 0%, rgb(59, 130, 246) 0px, transparent 50%), radial-gradient(at 0% 50%, rgb(55, 48, 163) 0px, transparent 50%), radial-gradient(at 80% 50%, rgb(17, 24, 39) 0px, transparent 50%), radial-gradient(at 0% 100%, rgb(59, 130, 246) 0px, transparent 50%), radial-gradient(at 80% 100%, rgb(55, 48, 163) 0px, transparent 50%), radial-gradient(at 0% 0%, rgb(17, 24, 39) 0px, transparent 50%)',
          zIndex: 0,
          animation: 'gradient 15s ease infinite',
          backgroundSize: '400% 400%',
          transform: 'scale(1.5)',
          filter: 'blur(2px)'
        }}
      />

      {/* Partículas animadas */}
      <Box
        sx={{
          position: 'fixed',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          zIndex: 1,
          opacity: 0.5,
          '&::before': {
            content: '""',
            position: 'absolute',
            top: '50%',
            left: '50%',
            width: '600px',
            height: '600px',
            background: 'radial-gradient(circle, rgba(255,255,255,0.1) 0%, transparent 70%)',
            transform: 'translate(-50%, -50%)',
            animation: 'pulse 4s ease-in-out infinite'
          },
          '&::after': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: 'url("data:image/svg+xml,%3Csvg width=\'100\' height=\'100\' viewBox=\'0 0 100 100\' xmlns=\'http://www.w3.org/2000/svg\'%3E%3Ccircle cx=\'50\' cy=\'50\' r=\'1.5\' fill=\'%23ffffff\' fill-opacity=\'0.2\'/%3E%3C/svg%3E")',
            backgroundSize: '100px 100px',
            animation: 'float 8s ease-in-out infinite'
          }
        }}
      />

      {/* Efeito de luz superior */}
      <Box
        sx={{
          position: 'fixed',
          top: '-50%',
          left: '-10%',
          width: '120%',
          height: '500px',
          background: 'radial-gradient(ellipse at center, rgba(59, 130, 246, 0.15) 0%, transparent 70%)',
          transform: 'rotate(-12deg)',
          zIndex: 1,
          animation: 'pulse 8s ease-in-out infinite'
        }}
      />

      <Card 
        sx={{ 
          maxWidth: 480,
          width: '100%',
          background: 'rgba(17, 25, 40, 0.75)',
          backdropFilter: 'blur(20px)',
          borderRadius: 6,
          border: '1px solid rgba(255,255,255,0.1)',
          boxShadow: '0 8px 32px 0 rgba(0,0,0,0.4)',
          position: 'relative',
          overflow: 'hidden',
          zIndex: 2,
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: '-50%',
            width: '200%',
            height: '4px',
            background: 'linear-gradient(90deg, transparent, rgba(59, 130, 246, 0.6), transparent)',
            animation: 'shimmer 4s infinite linear'
          }
        }}
      >
        <CardContent sx={{ p: { xs: 3, sm: 5 } }}>
          <Stack spacing={4} alignItems="center">
            <Box sx={{ textAlign: 'center', mb: 2 }}>
              <Typography 
                variant="h3" 
                component="h1" 
                fontWeight={800} 
                sx={{ 
                  mb: 2,
                  background: 'linear-gradient(135deg, #fff 0%, #94A3B8 100%)',
                  backgroundClip: 'text',
                  WebkitBackgroundClip: 'text',
                  WebkitTextFillColor: 'transparent',
                  letterSpacing: '-0.5px'
                }}
              >
                Bem-vindo ao<br />App Sacados
              </Typography>
              <Typography 
                color="#94A3B8" 
                sx={{ 
                  fontSize: { xs: 16, sm: 18 },
                  maxWidth: 320,
                  mx: 'auto',
                  opacity: 0.9
                }}
              >
                Escolha seu perfil para continuar:
              </Typography>
            </Box>

            <Stack spacing={2} sx={{ width: '100%' }}>
              <Button
                variant="contained"
                size="large"
                startIcon={
                  <Box 
                    sx={{ 
                      background: 'rgba(59, 130, 246, 0.2)',
                      borderRadius: '12px',
                      p: 1,
                      display: 'flex'
                    }}
                  >
                    <LocalHospitalIcon sx={{ fontSize: 24 }} />
                  </Box>
                }
                sx={{
                  py: 2.5,
                  px: 3,
                  borderRadius: 3,
                  background: 'linear-gradient(135deg, rgb(59, 130, 246) 0%, rgb(37, 99, 235) 100%)',
                  fontSize: 18,
                  fontWeight: 600,
                  justifyContent: 'flex-start',
                  '&:hover': {
                    background: 'linear-gradient(135deg, rgb(96, 165, 250) 0%, rgb(59, 130, 246) 100%)',
                    transform: 'translateY(-2px)',
                    boxShadow: '0 6px 20px rgba(59, 130, 246, 0.4)'
                  },
                  transition: 'all 0.3s ease'
                }}
                onClick={() => history.push('/cadastro-clinica')}
              >
                Sou Clínica
              </Button>

              <Button
                variant="outlined"
                size="large"
                startIcon={
                  <Box 
                    sx={{ 
                      background: 'rgba(59, 130, 246, 0.1)',
                      borderRadius: '12px',
                      p: 1,
                      display: 'flex'
                    }}
                  >
                    <PersonIcon sx={{ fontSize: 24 }} />
                  </Box>
                }
                sx={{
                  py: 2.5,
                  px: 3,
                  borderRadius: 3,
                  borderColor: 'rgba(59, 130, 246, 0.3)',
                  color: '#fff',
                  fontSize: 18,
                  fontWeight: 600,
                  justifyContent: 'flex-start',
                  '&:hover': {
                    borderColor: 'rgb(59, 130, 246)',
                    background: 'rgba(59, 130, 246, 0.08)',
                    transform: 'translateY(-2px)'
                  },
                  transition: 'all 0.3s ease'
                }}
                onClick={() => history.push('/cadastro-paciente')}
              >
                Sou Paciente
              </Button>
            </Stack>

            <Typography 
              component="a"
              href="/login"
              sx={{ 
                color: 'rgb(147, 197, 253)',
                textDecoration: 'none',
                fontSize: 15,
                fontWeight: 500,
                '&:hover': {
                  color: 'rgb(59, 130, 246)',
                  textDecoration: 'underline'
                },
                cursor: 'pointer'
              }}
              onClick={(e) => {
                e.preventDefault();
                history.push('/login');
              }}
            >
              Já tenho uma conta
            </Typography>
          </Stack>
        </CardContent>
      </Card>
    </Box>
  );
}
